import React, { useState } from 'react';
import DrynessConcern from './DrynessConcern';
import DamageConcern from './DamageConcern';
import FrizzConcern from './FrizzConcern';
import CurlSupportConcern from './CurlSupportConcern';

const Concerns = () => {
  const [currentView, setCurrentView] = useState(null);

  const handleViewChange = (view) => {
    setCurrentView(view);
  };

  return (
    <div className="concerns-page">
      <h2>Choose Your Concern</h2>
      <div className="concerns-grid">
        <DrynessConcern onViewChange={handleViewChange} />
        <DamageConcern onViewChange={handleViewChange} />
        <FrizzConcern onViewChange={handleViewChange} />
        <CurlSupportConcern onViewChange={handleViewChange} />
        {/* Add more concerns as needed */}
      </div>
    </div>
  );
};

export default Concerns;
